import * as React from "react";
import { Box } from "@mui/system";
import HistoricalData from "./historical_data";

class Chart extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
           currentAgeState: props.currentage,
           lifeExpectancyState: props.lifeexpectancy,
           portfolioValueState: props.portfoliovalue,
           spendModelState: props.spendmodel,
           stockAllocationState: props.stockallocation,
           bondAllocationState: props.bondallocation,
           ssIncomeState: ssincome,
           ssAgeState: ssage,
        }
    }  

    render () {
        return (
            <Box sx={{
                boxShadow: 10,
                borderRadius: 10,
                p: 2,
                minWidth: 1200,
                minHeight: 1200,

            }} >           
                <div>
                    current age {currentAgeState}

                </div>
                <HistoricalData />
             </Box>

        );
    };
};

export default Chart;
